import Link from "next/link";
import css from "./Header.css";

const Header = props => (
  <div className={css.header}>
    <Link href="">
      <a>
        <img className={css.headerImage} src={props.imageUrl} />
      </a>
    </Link>
  </div>
);

export default Header;
